import React from "react";

export const ContactForm = ({
  name,
  phone,
  email,
  nameSetter,
  phoneSetter,
  emailSetter,
  submitHandler,
}) => {
  const pattern =
    "^(+(1-)?d{1,3})?(s|-)?(s|-)?(((d{2})|d{2})(s|-)?d{4}|((d{3})|d{3})(s|-)?d{3})(s|-)?d{4}(s)?(x|ext|ext.)?(d{1,6})?,?(d{1,6})?,?(d{1,6})?$";
  return (
    <form onSubmit={submitHandler}>
      <input
        placeholder="Name"
        type="text"
        value={name}
        onChange={(e) => nameSetter(e.target.value)}
      />
      <input
        placeholder="Phone"
        type="num"
        value={phone}
        pattern={pattern}
        onChange={(e) => phoneSetter(e.target.value)}
      />
      <input
        placeholder="email"
        type="text"
        value={email}
        onChange={(e) => emailSetter(e.target.value)}
      />
    </form>
  );
};
